create table Clients (
	id INT,
	first_name VARCHAR(50),
	last_name VARCHAR(50),
	phone VARCHAR(50),
	gender VARCHAR(50),
	age INT,
	city VARCHAR(50),
	subscription_expiration DATE
);




create table Books (
	id INT,
	genre VARCHAR(50),
	autor VARCHAR(50),
	library_id INT
);

create table Librarys (
	id INT,
	city VARCHAR(50),
	address VARCHAR(50)
);


create table LibraryBooks (
	id INT,
	book_id INT,
	library_id INT
);



create table ReservedBooks (
	id INT,
	client_id INT,
	library_id INT,
	reservation_date DATE
);

